/**
 * Resume Base64 Data
 * 
 * To update: Replace the base64 string below with your encoded resume PDF
 * 
 * Steps to encode your PDF:
 * 1. Go to: https://www.base64encode.org/
 * 2. Upload your resume.pdf
 * 3. Copy the encoded string
 * 4. Paste it below (keep the "data:application/pdf;base64," prefix)
 */

export const resumeBase64 = "data:application/pdf;base64,";

// Helper function to download resume
export const downloadResume = () => {
  const link = document.createElement('a');
  link.href = resumeBase64;
  link.download = 'Vetrivel_Dharuman_Resume.pdf';
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
};

// Helper function to view resume in new tab
export const viewResume = () => {
  window.open(resumeBase64, '_blank');
};
